	public static char[][] toChar(String[] S) {
		char[][] board = new char[S.length][S[0].length()];
		for (int i = 0; i < S.length; ++i) {
			for (int j = 0; j < S[0].length(); ++j) {
				board[i][j] = S[i].charAt(j);
			}
		}
		return board;
	}

	public static void print2dArray(char[][] board) {
		for (char[] row : board) {
			for (char c : row) {
				System.out.print(c + " ");
			}
			System.out.println();
		}
	}
